TEST(ImageChannel, isWithinThreshold) {
    auto matrix = new Matrix<float>(
        mockImageRChannel,
        256,
        256,
        ROW_MAJOR
    );

    auto channel = Channel(255, matrix);
    auto normalizedChannel = channel.normalized();

    for (int i = 0; i < normalizedChannel->getRows(); i++) {
        for (int j = 0; j < normalizedChannel->getColumns(); j++) {
            auto ijElement = normalizedChannel->at(i, j);
            EXPECT_TRUE(ijElement >= 0 && ijElement <= 1);
        }
    }

    EXPECT_TRUE(normalizedChannel->getMaxTheoreticalValue() == 1);
}

TEST(ImageChannel, TestClamp) {
    auto matrix = new Matrix(
        mockImageRChannel,
        256,
        256,
        ROW_MAJOR
    );

    auto rd = std::random_device();
    auto uniformRangeDistribution = std::uniform_int_distribution(0, 255);
    auto randomBound = static_cast<float>(uniformRangeDistribution(rd));
    auto otherRandomBound = static_cast<float>(uniformRangeDistribution(rd));

    auto channel = Channel(255, matrix);
    auto clampedChannel = channel.clamped(std::min(randomBound, otherRandomBound), std::max(randomBound, otherRandomBound));

    for (int i = 0; i < clampedChannel->getRows(); i++) {
        for (int j = 0; j < clampedChannel->getColumns(); j++) {
            auto ijElement = clampedChannel->at(i, j);
            EXPECT_TRUE(ijElement >= std::min(randomBound, otherRandomBound) && ijElement <= std::max(randomBound, otherRandomBound));
        }
    }
}

TEST(ImageChannel, OutputPixelForKernel) {
    auto matrix = new Matrix<float>(
        mockImageRChannel,
        256,
        256,
        ROW_MAJOR
    );

    std::random_device rd;
    std::mt19937 e2(rd());

    auto intRNG = std::uniform_int_distribution(0, 255);
    auto randomRow = intRNG(e2);
    auto randomColumn = intRNG(e2);

    auto intRNGForKernelSize = std::uniform_int_distribution(1, (255 - 1) / 2);
    auto randomOddKernelSize = 2 * intRNGForKernelSize(e2) + 1;

    auto channel = new Channel(255, matrix);
    auto averageKernel = Kernels::averageKernel<float>(randomOddKernelSize);
    auto paddingStrategy = new ZeroPaddingMatrixPaddingStrategy<float>();

    float expectedValue = 0;
    for (int i = 0; i < randomOddKernelSize; i++) {
        for ( int j = 0; j < randomOddKernelSize; j++) {
            auto currentRowIndex = randomRow - (randomOddKernelSize - 1) / 2 + i;
            auto currentColumnIndex = randomColumn - (randomOddKernelSize - 1) / 2 + j;

            expectedValue += paddingStrategy->pad(*channel, currentRowIndex, currentColumnIndex) * averageKernel->getValue(-(randomOddKernelSize - 1) / 2 + i, -(randomOddKernelSize - 1) / 2 + j);
        }
    }

    EXPECT_FLOAT_EQ(expectedValue, channel->outputPixel(randomRow, randomColumn, averageKernel, paddingStrategy));

    auto identityKernel = Kernels::identity<float>(randomOddKernelSize);
    for (int i = 0; i < 256; i++) {
        for (int j = 0; j < 256; j++) {
            auto filteredPixel = channel->outputPixel(i, j, identityKernel, paddingStrategy);
            EXPECT_FLOAT_EQ(filteredPixel, channel->at(i, j));
        }
    }

    auto sameChannel = channel->filtered(identityKernel, paddingStrategy);
    for (int i = 0; i < 256; i++) {
        for (int j = 0; j < 256; j++) {
            EXPECT_FLOAT_EQ(sameChannel->at(i, j), channel->at(i, j));
        }
    }
}